/**
 * @param {number[][]} grid
 * @return {number}
 */
var maxDistance = function(grid) {
	let arr1 = [];
	let map0 = new Map();
	let k = 0;
	for (let i = 0; i < grid.length; i++) {
		for (let j = 0; j < grid[i].length; j++) {
			if (grid[i][j] === 1) arr1.push([i, j]);
			else map0.set(k++, [i, j]);
		}
	}
	let arr1Length = arr1.length;
	if (map0.size == 0 || arr1Length == 0) return -1;

	function increaseStep(step) {
		for (let i = 0; i < arr1Length; i++) {
			for (let [key, v] of map0.entries()) {
				if (Math.abs(arr1[i][0] - v[0]) + Math.abs(arr1[i][1] - v[1]) === step) map0.delete(key);
			}
		}
		// 距离为step时，被删光了。也就是最大距离为step
		if (!map0.size) return step;
		// 否则，扩大距离，go on
		return increaseStep(step + 1);
	}
	return increaseStep(1);
};
